import { Route,Routes } from "react-router-dom";

const RoutesLink = () => {
    return (
        <>
            <Routes>
                <Route path=""/>
                <Route />
                <Route />
                <Route />
            </Routes>
        </>
    )
};

export default RoutesLink;
